import React from 'react';
import { increaseCount, decreaseCount } from './Redux/Actions/counterAction';
import { useSelector, useDispatch } from 'react-redux';

export default function Changecount() {
    const state = useSelector(state=>state);
    const dispatch = useDispatch();
  return (
    <div>
        <button onClick={()=>dispatch(increaseCount())}>Increment</button>
        <button onClick={()=>dispatch(decreaseCount())}>Decrement</button>
    </div>
  )
}
